import React from "react";
import { NavLink } from "react-router-dom";
import MyNavLink from "./MyNavLink";

export default function Nav() {
  return (
    <nav>
      <ul>
        <li>
          <MyNavLink title="Homepage" path="/" />
        </li>
        <li>
          <MyNavLink title="Add Data" path="/data/add" />
        </li>
        <li>
          <MyNavLink title="Tag Data" path="/data/tag" />
        </li>
      </ul>
    </nav>
  );
}

